import React from 'react';
import './App.css';

const TeamMember = ({ name, picture, bio }) => {
  return (
    <div className="team-member">
      <img src={picture} alt={name} className="team-member-image" />
      <div className="team-member-info">
        <h3 className="team-member-name">{name}</h3>
        <p className="team-member-bio">{bio}</p>
      </div>
    </div>
  );
};

const aboutUsTeam = [
  {
    name: 'John Doe',
    picture: '"D:\react\Images\Akash.png"',
    bio: 'John is an experienced software developer with a passion for React.',
  },
  {
    name: 'Jane Doe',
    picture: 'path/to/jane-doe-picture.jpg',
    bio: 'Jane has a strong background in web development and enjoys crafting user interfaces with React.',
  },
];

const App = () => {
  return (
    <div className="about-us">
      <h2 className="about-us-header">Here are the members of our development team:</h2>
      <div className="team-members">
        {aboutUsTeam.map((member, index) => (
          <TeamMember key={index} {...member} />
        ))}
      </div>
    </div>
  );
};

export default App;
